# ZIP Code Validator
class ZIPCodeValidator:
    def validate_ppop_zip(self, zip_code: str) -> bool:
        """Validate PPoP ZIP+4 codes."""
        pattern = r'^\d{5}(-\d{4})?$'
        return bool(re.match(pattern, zip_code))

