class TestingScheduler:
    def schedule_user_testing(self, tester_ids: List[str], features: List[str]) -> Dict:
        """Schedule user testing with testers."""
        schedule = {}
        for tester_id in tester_ids:
            schedule[tester_id] = {
                'features': features,
                'scheduled_time': datetime.datetime.now() + datetime.timedelta(days=7)
            }
        return schedule

# Testing Feedback Analyzer
class TestingFeedbackAnalyzer:
    def create_feedback_summary(self, feedback_data: List[Dict]) -> Dict:
        """Create summaries from user testing feedback."""
        positive = sum(1 for f in feedback_data if f.get('sentiment') == 'positive')
        negative = sum(1 for f in feedback_data if f.get('sentiment') == 'negative')

        return {
            'total_feedback': len(feedback_data),
            'positive': positive,
            'negative': negative,
            'key_findings': [f['comment'] for f in feedback_data if 'comment' in f]
        }

