# Request Cacher
class RequestCacher:
    def __init__(self):
        self.cache = {}

    def cache_generation_request(self, request_id: str, data: Dict) -> bool:
        """Cache a file generation request."""
        self.cache[request_id] = data
        return True

    def check_cache(self, request_id: str) -> Optional[Dict]:
        """Check for cached request."""
