# Double Publish Preventer
class DoublePublishPreventer:
    def __init__(self):
        self.published_submissions = set()

    def prevent_double_publish(self, submission_id: str) -> bool:
        """Prevent double publishing of submissions."""
        if submission_id in self.published_submissions:
            return False
        self.published_submissions.add(submission_id)
        return True

