# SAM Data Validator
class SAMDataValidator:
    def validate_sam_completeness(self, sam_data: Dict) -> Dict:
        """Validate SAM data completeness."""
        required_fields = ['uei', 'legal_name', 'address']
        missing = [field for field in required_fields if field not in sam_data]
        return {
            'is_valid': len(missing) == 0,
            'missing_fields': missing
        }

# Schema Validator
class SchemaValidator:
    def validate_field_lengths(self, data: Dict, schema: Dict) -> Dict:
        """Validate field lengths against schema requirements."""
        errors = []
        for field, config in schema.items():
            value = data.get(field, '')
            max_len = config.get('max_length')
            if max_len and len(str(value)) > max_len:
                errors.append(f"Field {field} exceeds max length {max_len}")
        return {'is_valid': len(errors) == 0, 'errors': errors}

